<!DOCTYPE html>
<html lang="en">
<head>

<style>
    *{
        padding: 0;
        margin: 0;
        box-sizing: border-box;
    }
    body{
        width: 100%;
        height: 100vh;
        /* background: rgb(160, 170, 212); */
    }
    #svg_logo{
        height: 400px;
        position: absolute;
        top:50%;
        /* background: yellow;
        color: teal; */
        left: 50%;
        transform: translate(-50%, -50%);
    }
    #svg_logo path{
        transform-origin: center;
        transition: .5s;
    }

    #svg_logo path:nth-child(even){
        stroke-dasharray: 750;
        stroke-dashoffset: 750;
        animation: line-anim 3s ease forwards .2s;
    }
    #svg_logo path:nth-child(odd){
        stroke-dasharray:550;
        stroke-dashoffset: 550;
        animation: line-anim 3s ease forwards .5s;
    }
    @keyframes line-anim{
        to{
            stroke-dashoffset: 0;
        }
    }

</style>
